import React from "react";

class Home extends React.Component{
    constructor(){
        super();
        this.state={
            title: 'Home Page',
        }
    }

    render(){
        return(
            <div>
                <h6> {this.state.title} </h6>
            </div>
        )
    }
}
export default Home;
